  import React from 'react';
  import { mdx } from '@mdx-js/react';

  export const frontMatter = {
	title: '迁移 CLI 工具指南',
	description: '迁移工具 CLI 含有多种命令和选项，以帮助您从 Rancher v1.6 迁移到 Rancherv2.x。',
	keywords: [
		'rancher 2.0中文文档',
		'rancher 2.x 中文文档',
		'rancher中文',
		'rancher 2.0中文',
		'rancher2',
		'rancher教程',
		'rancher中国',
		'rancher 2.0',
		'rancher2.0 中文教程',
		'版本迁移',
		'迁移服务',
		'迁移 CLI 工具指南'
	]
};
export const metadata = {
  "id": "rancher2/v1.6-migration/run-migration-tool/migration-tools-ref/_index",
  "title": "迁移 CLI 工具指南",
  "description": "迁移工具 CLI 含有多种命令和选项，以帮助您从 Rancher v1.6 迁移到 Rancherv2.x。",
  "source": "@site/docs/rancher2/v1.6-migration/run-migration-tool/migration-tools-ref/_index.md",
  "permalink": "/docs/rancher2/v1.6-migration/run-migration-tool/migration-tools-ref/_index",
  "editUrl": "https://github.com/cnrancher/docs-rancher2/edit/master/docs/rancher2/v1.6-migration/run-migration-tool/migration-tools-ref/_index.md",
  "lastUpdatedBy": "Author",
  "lastUpdatedAt": 1539502055
};
