export const rightToc = [{
  value: '下载',
  id: '下载',
  children: []
}, {
  value: '用法',
  id: '用法',
  children: []
}, {
  value: '迁移工具全局选项',
  id: '迁移工具全局选项',
  children: []
}, {
  value: '命令和命令选项',
  id: '命令和命令选项',
  children: []
}];
const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {
  rightToc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p>{`迁移工具 CLI 含有多种命令和选项，以帮助您从 Rancher v1.6 迁移到 Rancherv2.x。`}</p>
    <h3 {...{
      "id": "下载"
    }}>{`下载`}</h3>
    <p>{`可以从我们的平台下载适用于您平台的迁移工具 CLI `}<a parentName="p" {...{
        "href": "https://github.com/rancher/migration-tools/releases"
      }}>{`GitHub 发布页面`}</a>{`. 该工具可用于 Linux，Mac 和 Windows 平台。`}</p>
    <h3 {...{
      "id": "用法"
    }}>{`用法`}</h3>
    <pre><code parentName="pre" {...{}}>{`migration-tools [global options] command [command options] [arguments...]
`}</code></pre>
    <h3 {...{
      "id": "迁移工具全局选项"
    }}>{`迁移工具全局选项`}</h3>
    <p>{`迁移工具 CLI 包含一些全局选项。`}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`全局选项`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`描述`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--debug`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`启用调试日志记录。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--log <VALUE>`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`将日志输出到您输入的路径。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--help`}</inlineCode>{`, `}<inlineCode parentName="td">{`-h`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`显示所有可用命令的列表。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--version`}</inlineCode>{`, `}<inlineCode parentName="td">{`-v`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`打印正在使用的迁移工具 CLI 的版本。`}</td>
        </tr>
      </tbody>
    </table>
    <h3 {...{
      "id": "命令和命令选项"
    }}>{`命令和命令选项`}</h3>
    <h4 {...{
      "id": "迁移工具导出参考"
    }}>{`迁移工具导出参考`}</h4>
    <p><inlineCode parentName="p">{`migration-tools export`}</inlineCode>{`命令将 Rancher v1.6 服务器中的所有堆栈导出到 Compose 文件中。`}</p>
    <h5 {...{
      "id": "选项"
    }}>{`选项`}</h5>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`选项`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`必需?`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`描述`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--url <VALUE>`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`✓`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Rancher API 端点 URL (`}<inlineCode parentName="td">{`<RANCHER_URL>`}</inlineCode>{`).`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--access-key <VALUE>`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`✓`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Rancher API 访问密钥。使用帐户 API 密钥可导出所有 cattle 环境中的所有堆栈 (`}<inlineCode parentName="td">{`<RANCHER_ACCESS_KEY>`}</inlineCode>{`).`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--secret-key <VALUE>`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`✓`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`与访问密钥关联的 Rancher API 秘密密钥。(`}<inlineCode parentName="td">{`<RANCHER_SECRET_KEY>`}</inlineCode>{`).`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--export-dir <VALUE>`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`组成文件导出到的基本目录，该目录在每个环境/堆栈创建的子目录下 (默认: `}<inlineCode parentName="td">{`Export`}</inlineCode>{`).`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--all`}</inlineCode>{`, `}<inlineCode parentName="td">{`--a`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`导出所有堆栈。使用此标志可以导出处于不活跃，已停止或正在移除状态的所有堆栈。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--system`}</inlineCode>{`, `}<inlineCode parentName="td">{`--s`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`导出系统和基础结构堆栈。`}</td>
        </tr>
      </tbody>
    </table>
    <h5 {...{
      "id": "用法-1"
    }}>{`用法`}</h5>
    <p>{`执行以下命令，将每个占位符替换为您的值。访问密钥和密钥令牌是帐户 API 密钥，可让您从所有 Cattle 环境中导出。`}</p>
    <pre><code parentName="pre" {...{}}>{`migration-tools export --url <RANCHER_URL> --access-key <RANCHER_ACCESS_KEY> --secret-key <RANCHER_SECRET_KEY> --export-dir <EXPORT_DIR>
`}</code></pre>
    <p><strong parentName="p">{`结果:`}</strong>{` 迁移工具 CLI 在 `}<inlineCode parentName="p">{`--export-dir`}</inlineCode>{`目录中导出每个 Cattle 环境中每个堆栈的 Compose 文件。如果省略此选项，则文件将保存到当前目录。`}</p>
    <h4 {...{
      "id": "迁移工具解析参考"
    }}>{`迁移工具解析参考`}</h4>
    <p><inlineCode parentName="p">{`migration-tools parse`}</inlineCode>{`命令将 Compose 文件解析为堆栈并使用`}<a parentName="p" {...{
        "href": "https://github.com/kubernetes/kompose"
      }}>{`Kompose`}</a>{`生成等效的 Kubernetes 清单。它还会输出一个 output.txt 文件，其中列出了所有需要人工干预才能转换为 Kubernetes 的结构体。`}</p>
    <h5 {...{
      "id": "选项-1"
    }}>{`选项`}</h5>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`选项`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`必需?`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`描述`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--docker-file <VALUE>`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`解析 Docker Compose 文件以输出 Kubernetes 清单(默认: `}<inlineCode parentName="td">{`docker-compose.yml`}</inlineCode>{`)`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--output-file <VALUE>`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`输出列表检查和转换建议的文件名 (默认: `}<inlineCode parentName="td">{`output.txt`}</inlineCode>{`).`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--rancher-file <VALUE>`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`解析 Rancher Compose 文件以输出 Kubernetes 清单(默认: `}<inlineCode parentName="td">{`rancher-compose.yml`}</inlineCode>{`)`}</td>
        </tr>
      </tbody>
    </table>
    <h5 {...{
      "id": "子指令"
    }}>{`子指令`}</h5>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`子指令`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`描述`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`help`}</inlineCode>{`, `}<inlineCode parentName="td">{`h`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`显示可与前面的命令一起使用的选项列表。`}</td>
        </tr>
      </tbody>
    </table>
    <h5 {...{
      "id": "用法-2"
    }}>{`用法`}</h5>
    <p>{`执行以下命令，将每个占位符替换为堆栈的 Compose 文件的绝对路径。对于每个堆栈，您必须为导出的每对 Compose 文件重新运行该命令。`}</p>
    <pre><code parentName="pre" {...{}}>{`migration-tools parse --docker-file <DOCKER_COMPOSE_ABSOLUTE_PATH> --rancher-file <RANCHER_COMPOSE_ABSOLUTE_PATH>
`}</code></pre>
    <blockquote>
      <p parentName="blockquote"><strong parentName="p">{`注意:`}</strong>{` 如果您在命令中省略了`}<inlineCode parentName="p">{`--docker-file`}</inlineCode>{`和`}<inlineCode parentName="p">{`--rancher-file`}</inlineCode>{`选项，则迁移工具 CLI 会在其主目录中检查这些 Compose 文件。`}</p>
    </blockquote>
    <p><strong parentName="p">{`结果:`}</strong>{` 迁移工具 CLI 会解析您的 Compose 文件并输出 Kubernetes 清单规范以及一个`}<inlineCode parentName="p">{`output.txt`}</inlineCode>{`文件。对于堆栈中的每个服务，都将创建一个 Kubernetes 清单，并将其命名为与您的服务相同的名称。`}<inlineCode parentName="p">{`output.txt`}</inlineCode>{`文件列出了 `}<inlineCode parentName="p">{`docker-compose.yml`}</inlineCode>{`中每个服务的所有结构，需要特殊处理才能成功迁移到 Rancherv2.x。每个结构都链接到有关如何在 Rancher v2.x 中实现它的相关博客文章。`}</p>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
